function LoadData() {
    console.log("on load fired")
    if (companyList.length < 1) { companyList = csvToMap(); }
}

function replaceText(node) {
    console.log("in replaceText")
    const leftNavDivs = document.getElementsByClassName("scaffold-layout__list ");


    for (j = 0; j < leftNavDivs.length; j++) {
        let companyTitleDivs = leftNavDivs[j].getElementsByClassName("artdeco-entity-lockup__subtitle ember-view");

        //console.log("companyTitleDivs: " + companyTitleDivs.length)
        for (i = 0; i < companyTitleDivs.length; i++) {
            try {
                let companyTitleDiv = companyTitleDivs[i];
               // console.log("in companyTitleDiv ")
                let companyTitleSpans = companyTitleDiv.getElementsByTagName("span")
                //console.log("in companyTitleSpan ")
                if (companyTitleSpans === undefined || companyTitleSpans.length<1) { continue; }
               // console.log("companyTitleSpan")
                let companyTitleSpan = companyTitleSpans[0]
                let companyName = companyTitleSpan.innerText;
              //  console.log("companyName: " + companyName)
                if (companyName.includes(" | ")) { continue; }
              //  console.log("Updating companyName")
                let term = companyName.trim().toUpperCase()
                let sponsorData = companyList.find(company => company.includes(term));
                if (sponsorData === undefined) {
                    companyTitleSpan.innerText = companyName+ " | ";
                }
                else {
                    let cases = sponsorData.split(",")[1]
                    let status = companyName + " | H1B Friendly (" + cases + ")";
                    
                    companyTitleSpan.innerText = status;
                    companyTitleSpan.title = status;
                }
            } catch (error) {
                console.error('Error replacetext:', error);
                continue;
            }

        }
    }
}

LoadData();
replaceText(document.body);

// Now monitor the DOM for additions and substitute emoji into new nodes.
// @see https://developer.mozilla.org/en-US/docs/Web/API/MutationObserver.
//https://github.com/mdn/webextensions-examples/blob/main/emoji-substitution/manifest.json

const observer = new MutationObserver((mutations) => {
    mutations.forEach((mutation) => {
        if (mutation.addedNodes && mutation.addedNodes.length > 0) {
            // This DOM change was new nodes being added. Run our substitution
            // algorithm on each newly added node.
            for (let i = 0; i < mutation.addedNodes.length; i++) {
                const newNode = mutation.addedNodes[i];
                 replaceText(newNode);
            }
        }
    });
});
observer.observe(document.body, {
    childList: true,
    subtree: true
});



